Neunistivi (1990) Domaci Film



Rezija: Vladimir Tadej

Uloge: Boris Dvornik, Velimir Bata Zivojinovic, Martin Sagner, Jovan Janicijevic Burdus, Nada Blam, Vida Jerman, Eugen Franjkovic, Irena Jug, Antun Nalis, Kostadinka Velkovska, Relja Basic, Zvonimir Ferencic, Zvonko Strmac, Smiljka Bencet, Ilija Ivezic, Zdravka Krstulovic, Nikola Novosel, Vladimir Oblescuk, Ksenija Marinkovic, Ruzica Sokic...

Opis: S obzirom da je serija snimljena neposredno pre raspada Jugoslavije, reziser i scenarista Vladimir Tadej je posljednji put zeleo da okupi tada najpoznatije glumce-komicare, jer se vec ranije znalo da to vise nece biti moguce...

